import React from "react";

const Auth = ({regNo, setRegNo, dob, setDob, isAuth, setIsAuth}) => {  
  return (
    <div>
      <h2>Login</h2>
      <form>
        <label>Register Number : </label>
        <input
            value={regNo}
            onChange={(e) => setRegNo(e.target.value)}
            type="text"
            required
            />
        <label>Date Of Birth : </label>
        <input
            value={dob}
            onChange={(e) => setDob(e.target.value)}
            type="Date"
            required
            />
      </form>
    </div>
  );
};

export default Auth;
